import React from "react";
import Navbar from "../components/Navbar";
import Coding_gif from "../assets/coding gif.gif";
import "../css"
const Challenge = () => {
    return(
        <>
         <Navbar />
         <div className="no_challenge">
            <img src={Coding_gif}/>
         </div>

        
        </>
        
    )
};

export default Challenge;
